    const [ text, setText ] = useState();
    let result;
    const load = () => {
        fetch( './fooddrinkdata.csv'  )
            .then( response => response.text() )
            .then(async responseText => {
                result = await Papa.parse( responseText,  {header: true,});
                console.log(result.data[0].category);
            })
    };

    load();

    return (<h1>{result.data[0].category}</h1>)
};

